#include <iostream>
#include <algorithm>
#include <string>
#include <vector>
#include <map>
#include <iomanip>
#include <cmath>
#include <cstdlib>
#include <math.h>
#include <stdlib.h>

int main()
{
	bool inclu = false;
	std::vector<std::string> vec;
	std::string kouho, shiori, search;
	std::getline(std::cin, kouho);
	std::getline(std::cin, shiori);
	for(int i = 0; i < kouho.size(); i++){
		if(kouho[i] == '\r') continue;
		if(kouho[i] == ' '){
			if((int)shiori.find(search) > -1){
				bool dou = true;
				for(int j = 0; j < vec.size(); j++){
					if(vec[j] == search) dou = false;
				}
				if(dou){
					std::cout << search << std::endl;
					vec.push_back(search);
					inclu = true;
				}
			}
			search = "";
		}else{
			search += kouho[i];
		}
	}
	if((int)shiori.find(search) > -1){
				std::cout << search << std::endl;
				inclu = true;
	}
	if(!inclu) std::cout << "Not Included!" << std::endl;
	return 0;
}
